ntent = get(vo.editor, 'ui.view.editable.element') //可編輯區是element已通過v-deep設為100%\n                let ele = get(eleContent, 'parentNode') //要把height設定至父層的高度才能響應調整\n\n                //update height\n                if (ele) {\n                    ele.style.height = vo.height + 'px'\n                }\n\n            })\n\n        },\n\n    },\n}\n<\/script>\n\n<style scoped>\n::v-deep .ck-content {\n    height:100%;\n}\n</style>\n"]},media:void 0})}),Kn,"data-v-4fbca63f",false,undefined,!1,Mn,void 0,void 0)}));
